```json
{
    "id":"g",
    "Z":"z",
    "subs":[
        {
            "id":"h",
            "Y":"y",
            "subs":[
                {
                    "id":"i",
                    "X":"x",
                    "subs":[]
                }
            ] // Missing closing bracket here
        }
    ] // Missing closing bracket here again
} // Missing closing brace here
```

